import React, { useState, useEffect } from 'react';
import { Card, Table } from 'react-bootstrap';
import axios from 'axios';
import { DateParser } from '../Data/Date';
const ReturnCard = (props) => {
    const [returnList, setReturnList] = useState(1);
    var config = {
        method: 'get',
        url: 'http://localhost:8765/api/return/',
        headers: {
            'auth': localStorage.getItem('vmisJwt')
        }
    };
    useEffect(() => {
        axios(config).then(res =>
            setReturnList(res.data)
        ).catch()
    }, [props.dependency])
    return (
        <div className="my-2">
            {returnList ?
                Object.keys(returnList).map((key, index) => {
                    return (
                        <Card style={{ width: '18rem' }} className="m-1" key={index}>
                            <Card.Header className="bg-info text-center font-weight-bold text-light">On {DateParser(returnList[key][0].date)}</Card.Header>
                            <Card.Body className="p-0">
                                <Card.Text>
                                    <Table responsive size="md" key={index} striped bordered hover styl={{margin:'0px !impor'}}>
                                        <thead>
                                            <tr>
                                                <th>Vaccine</th>
                                                <th>Quantity</th>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            {returnList[key].map((key1, index1) => {
                                                return (<tr key={index1}><td>{key1.shortname}</td><td>{key1.quantity}</td></tr>)
                                            })}
                                        </tbody>
                                    </Table>
                                </Card.Text>
                            </Card.Body>
                        </Card>
                    )
                })
                : <div className="alert alert-info text-center">No returns made yet</div>}
        </div>
    );
}

export default ReturnCard;
